import React from "react";
class StudentViewandRegister extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      jobs: this.props.location.state.jobs,
      jobid: this.props.location.state.jobid,
      printjob: null
    };
  }
  render() {
    for (var i = 0; i < this.state.jobs.length; i++) {
      if (this.state.jobs[i].jobid == this.state.jobid) {
        var printjob = this.state.jobs[i];
        break;
      }
    }
    console.log(printjob.jobtitle);
    return (
      <div>
        <div className="container">
          <div class="row">
            <div class="col-25">JOB Title :</div>
            <div class="col-75">{this.state.companyname || ""}</div>
          </div>
          <div class="row">
            <div class="col-25">JOB Title :</div>
            <div class="col-75">{this.state.jobtitle || ""}</div>
          </div>
          <div class="row">
            <div class="col-25">JOB Title :</div>
            <div class="col-75">{this.state.jobdescription || ""}</div>
          </div>
          <div class="row">
            <div class="col-25">JOB Title :</div>
            <div class="col-75">{this.state.postingdate || ""}</div>
          </div>
          <div class="row">
            <div class="col-25">JOB Title :</div>
            <div class="col-75">{this.state.applicationdeadline || ""}</div>
          </div>
          <div class="row">
            <div class="col-25">JOB Title :</div>
            <div class="col-75">{this.state.location || ""}</div>
          </div>
          <div class="row">
            <div class="col-25">JOB Title :</div>
            <div class="col-75">{this.state.salary || ""}</div>
          </div>
        </div>
      </div>
    );
  }
}

export default StudentViewandRegister;
